import { createSlice } from "@reduxjs/toolkit";


const initialState = {
    showPanel: false,
    isLoading: false,
    url: "data:image/jpeg;base64,",
}

const inputImageSlice = createSlice({
    name: "imageInput",
    initialState,
    reducers: {
        setDataURL(state, action) {
            state.url = action.payload
        },
        setIsLoading(state, action) {
            state.isLoading = action.payload
        },
        setShowPanel(state, action) {
            state.showPanel = action.payload
        }
    }
})

export default inputImageSlice.reducer
export const { setDataURL, setIsLoading, setShowPanel } = inputImageSlice.actions